import React from 'react'
import NavBar from './NavBar'
import {
  Outlet
} from "react-router-dom";


export default function HomePage() {
  return (
    <>
    <div className='page'>
    <NavBar />
     <div className='nav-links-elaborator'>
       <Outlet />
     </div>
    </div>

    </>
  )
}
